import React from 'react';
import { Route, Switch } from 'react-router-dom';
import TestComponent from './components/TestComponent.js';

function App() {
  return(
    <>
      <Switch>
        <Route path="/" exact component={TestComponent} />
      </Switch>
    </>
  )
}

export default App;
